import './App.css';

import ReactMapGL from 'react-map-gl';
const [viewport, setViewport] = useState({
  width: 500,
  height: 300,
  latitude: -86.921195,
  longitude: 40.423705,
  zoom: 10
});
function App() {
  return (
    <ReactMapGL
                {...viewport}
                mapboxAccessToken = {test}

                onViewportChange = {nextViewport => setViewport(nextViewport)}
    />
  );
}

export default App;
